import React from 'react';
import Netflix from './Netflix';
import Amazon from './Amazon';

const favSeries = "Netflix";

const Favs = () => {
  if (favSeries === "Netflix"){
    return <Netflix />
    }
    else {
    return <Amazon />
        }
}



    
const App = () =>(
                     <>
                        <h1 className="heading_style ">list of top 5 seris</h1>
                         {Favs()}
                    </>
  
                );
export default App;
